import Ficha from "../Ficha/Ficha"
import "./FichaGrid.css"

const FichaGrid = () => {
    const fichasData = [
        {
            title: "Titulo 1",
            dato: 90,
            icon: "fa-clipboard-list"
        },
        {
            title: "Titulo 2",
            dato: 90,
            icon: "fa-dollar-sign"
        },
        {
            title: "Titulo 3",
            dato: 90,
            icon: "fa-user"
        },
    ]
    return(
        <section className="top-data">
            <Ficha title = "Titulo 1" dato = {90} icon = "fa-clipboard-list"  />
            <Ficha title = "Titulo 2" dato = {90} icon = "fa-dollar-sign" />
            <Ficha title = "Titulo 3" dato = {90} icon = "fa-user" />

            {
                fichasData.map()
            }
        </section>
    )
}
export default FichaGrid
